import React from "react";
import { useNavigate } from "react-router-dom";

function LoginType() {
    const navigate = useNavigate();

    return (
        <div>
            <h2>Giriş Türünü Seçin</h2>
            <button onClick={() => navigate("/login", { state: { role: "admin" } })}>Admin Girişi</button>
            <button onClick={() => navigate("/login", { state: { role: "user" } })}>Kullanıcı Girişi</button>
        </div>
    );
}

export default LoginType; // ← Bu satır önemli
